import PostListItem from '../post-list-item';

import './post-list.css';

const PostList = () =>{
    return(
        <ul className = 'app-list list-group'>
            <PostListItem label/>
            <PostListItem/>
            <PostListItem/>
        </ul>
    )
    
}

export default PostList;
